INSERT INTO `t113_comp` VALUES (1,1,'Способен решать прикладные задачи строительной отрасли, используя теорию и методы фундаментальных наук','ОПК-1','Общепрофессиональная','{B4F35809-346F-451B-917C-F4C2634A1FDD}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(2,1,'Способен осуществлять и организовывать техническую эксплуатацию, техническое обслуживание и ремонт зданий и сооружений, осуществлять мониторинг, контроль и надзор в сфере безопасности зданий и сооружений','ОПК-10','Общепрофессиональная','{DEE803A3-415B-41AC-853B-0A1AAD6C9620}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(3,1,'Способен осуществлять постановку и решение научно-технических задач строительной отрасли, выполнять экспериментальные исследования и математическое моделирование, анализировать их результаты, осуществлять организацию выполнения научных исследований','ОПК-11','Общепрофессиональная','{DAC52186-9FBD-4AAD-80D9-0E24E8D05B2F}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(4,1,'Способен анализировать и представлять информацию, применять информационные и компьютерные технологии для работы с информацией и приобретения новых знаний в профессиональной деятельности, применять в проектной деятельности средства автоматизированного проектирования','ОПК-2','Общепрофессиональная','{459FCAA2-011F-4219-A6A8-6F810B51ECE1}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(5,1,'Способен принимать решения в профессиональной деятельности, используя теоретические основы, нормативно-правовую базу, практический опыт капитального строительства, а также знания о современном уровне его развития','ОПК-3','Общепрофессиональная','{C7226FA0-AFB7-4F46-9733-74544535AC0C}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(6,1,'Способен разрабатывать проектную и распорядительную документацию, участвовать в разработке нормативных правовых актов в области капитального строительства','ОПК-4','Общепрофессиональная','{DB9CAEA9-39A3-4A92-BD08-98D7FAEDE35C}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(7,1,'Способен участвовать в инженерных изысканиях и осуществлять техническое руководство проектно-изыскательскими работами в строительной отрасли','ОПК-5','Общепрофессиональная','{E64EAAF2-E56F-4BC6-ADDD-4A65A7492462}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(8,1,'Способен осуществлять и организовывать разработку проектов зданий и сооружений с учетом экономических, экологических и социальных требований и требований безопасности, способен выполнять технико-экономическое обоснование проектных решений зданий и сооружений, осуществлять техническую экспертизу проектов и авторский надзор за их соблюдением','ОПК-6','Общепрофессиональная','{102BF043-69A8-4253-A46A-8BBBD971E8E4}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(9,1,'Способен внедрять и адаптировать системы менеджмента качества в производственном подразделении с применением различных методов измерения, контроля и диагностики','ОПК-7','Общепрофессиональная','{F5ED78B3-8BB2-43FC-B70D-8920928EF344}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(10,1,'Способен применять стандартные, осваивать и внедрять новые технологии работ в области строительства, совершенствовать производ-ственно-технологический процесс строительного производства, разрабатывать и осуществлять мероприятия контроля технологических процессов строительного производства, по обеспечению производственной и экологической безопасности','ОПК-8','Общепрофессиональная','{1A7EDF95-6905-4264-A2B3-D97646ACB0C0}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(11,1,'Способен организовать работу и управлять коллективом производственных подразделений по строительству, обслуживанию, эксплуатации, ремонту, реконструкции, демонтажу зданий и сооружений, осуществлять организацию и управление производственной деятельностью строительной организации','ОПК-9','Общепрофессиональная','{251B9C62-E1D7-4A72-9738-47B24D36EBF9}','{EA0F23CE-096B-4F2A-A91D-F46134937BC7}'),(12,1,'Способен осуществлять моделирование и расчетный анализ для обоснования конструктивной надежности и безопасности объектов Градостроительной деятельности в части ус