INSERT INTO `t121_quest` VALUES (1,1,1,1,1,1,4,'Автором текста «Спрячь за высоким забором девчонку - выкраду вместе с забором….» является',NULL,'2',NULL,NULL,NULL,NULL),(2,1,1,2,1,1,4,'К знаменитым заборам не относится',NULL,'2',NULL,NULL,NULL,NULL),(3,1,1,3,2,1,4,'Как можно выполнить плетень?',NULL,'1,2',NULL,NULL,NULL,NULL),(4,1,1,4,2,1,4,'Какой может быть изгородь',NULL,'1,2',NULL,NULL,NULL,NULL),(5,1,1,5,3,2,1,'Максимальный срок службы плетня составляет … лет. (Ответ представьте целым числом)',NULL,'',NULL,NULL,NULL,NULL),(6,1,1,6,3,2,1,'Сколько жердей укрепляют на столбах при организации вертикального плетня? (Ответ представьте целым числом)',NULL,'',NULL,NULL,NULL,NULL),(7,1,1,7,4,2,1,'Изгородь – это легкий … .',NULL,'',NULL,NULL,NULL,NULL),(8,1,1,8,4,2,1,'Забор – это сооружение, которое охватывает … .',NULL,'',NULL,NULL,NULL,NULL),(9,1,1,9,5,3,6,'Укажите сроки заготовки лозы для плетения заборов','Наилучшим временем для заготовки лозы для плетения забора считается весна, пока в растении не началось сокодвижение. Также можно заготавливать лозу поздним летом и осенью, когда лоза приобретает наиболее насыщенный цвет и золотистый оттенок','',NULL,NULL,NULL,NULL),(10,1,1,10,5,3,5,'Назовите виды украшения плетней','Декоративные плетни могут быть украшены подпорными стенками, вазонами, кашпо и другими малыми архитектурными формами. Также они могут визуально гармонировать с плетёной садовой мебелью','',NULL,NULL,NULL,NULL),(11,1,1,11,5,3,7,'Дайте определение забора применительно к военному делу России','Забор в военном деле России - это искусственное противотранспортное, противодесантное и противопехотное заграждение, которое устраивается из колючей проволоки на вероятных путях продвижения противника, в местах, где объезд или обход забора затруднён','',NULL,NULL,NULL,NULL),(12,1,1,12,5,3,10,'Назовите невзрывные заграждения, использованные в военных конфликтах прошлого','В прежних военных конфликтах при обороне применяли ограды, частоколы, засеки, завалы, земляные рвы, земляные насыпи, волчьи ямы, ежи, сети, заборы из колючей проволоки и другие невзрывные заграждения.','',NULL,NULL,NULL,NULL);
/*!40000 ALTER TABLE `t121_quest` ENABLE KEYS */;
UNLOCK TABLES;

